// SPDX-License-Identifier: MIT

pragma solidity ^0.8.25;

contract receiveTest{
    /**
     * 19 receive fallback
     * 
     * receive() external payable{}
     * 
     * fallback() external payable{}
     */

    event e1(string msg);

    function makeMoney() external payable {
        emit e1("makeMoney");
    }

    receive() external payable{
        emit e1("receive");
    }

    fallback() external payable{
        emit e1("fallback");
    }

}

